import React, { Component } from 'react';

class RestorantSearch extends Component {
    constructor(){
        super();
        this.state = {
            searchData:null,
            noData:null,
        }
    }
    render() {
        return (
            <div>
                <h2>Restorant Search Component</h2>
                <input 
                type="text" 
                onChange={(event)=>{this.search(this.event.target.value)}} />
            </div>
        );
    }
}

export default RestorantSearch;
